import React, {useEffect} from 'react';
import  EZUIKit from 'ezuikit-js';

export default function (){
  useEffect(()=>{
    var player = new EZUIKit.EZUIKitPlayer('myPlayer');
    player.play();
  },[])

  return (
    <div>
      <video
        id="myplayer"
        src="https://open.ys7.com/v3/openlive/C20299604_1_1.m3u8?expire=1717160247&id=586297629818748928&t=0959d75e57570acfb12668edeec41bd5bb48b3311cb427e58ba798f4e452fc1b&ev=100"
        width="400"
        height="300"
      controls
      />

    </div>
  )
}
